import { BrowserRouter as Router } from 'react-router-dom';
import MainRouter from './routes/MainRouter';
import UserRouter from './routes/UserRouter';
import AdminRouter from './routes/AdminRouter';
function App() {
  return (
    <div className="App">
      <Router>
        <MainRouter />
        <AdminRouter />
        <UserRouter />
      </Router>
    </div>
  );
}

export default App;
